import './App.css';
import Background from './components/Background';
import Card from './components/Card';
import Logo from '../../assets/Logo.png';

function App() {
  return (
    <>
     <div className='MainContainer'>
     <img src={Logo} className="NavHeader" alt='Logo'/>
        <Background/>
        <Card/>
      </div>
    </>
  );
}

export default App;
